"use strict";

/* IMPORTS */
const expect = require('chai').expect;
const LoginScreen = require('../screenObjects/Login.screen');
const allure = require('@wdio/allure-reporter');

/* GETTERS AND METHODS */
class ConfigureIP {
  get setupHeading() {
    return $('~Setup');
  }
  get configureIPTextfield() {
    return $("/hierarchy/android.widget.FrameLayout/descendant::android.widget.EditText");
  }
  get continueBtn() {
    return $('~Continue');
  }
  async configureIP(ipaddress) {
    await (await this.setupHeading).waitForDisplayed({
      timeout: 10000,
      timeoutMsg: "Configure Ip Screen Not Displayed"
    });
    await allure.addStep(`Configure IP Screen is Displayed`);
    expect(await (await this.setupHeading).getAttribute('content-desc')).to.eq('Setup', "Configure IP Page not Displayed");
    await (await this.configureIPTextfield).waitForDisplayed({
      timeout: 10000,
      timeoutMsg: "ConfigureIP text field is not displayed"
    });
    await (await this.configureIPTextfield).click();
    await driver.waitUntil(async () => await (await this.configureIPTextfield).isEnabled(), {
      timeout: 5000,
      timeoutMsg: "Configure IP TextField Not Enabled"
    });
    await (await this.configureIPTextfield).setValue(ipaddress);
    await allure.addStep(`Entered ip address is ${ipaddress}`);
    const actualIP = await (await (await this.configureIPTextfield).getText()).split(',');
    await driver.waitUntil(async () => (await actualIP[0]) == ipaddress, {
      timeout: 5000,
      timeoutMsg: "Entered Ip is not reflected"
    });
    await expect(actualIP[0]).to.be.eq(ipaddress, "Displayed IP doesnt match with the entered IP");
    await driver.hideKeyboard();
    await (await this.continueBtn).waitForDisplayed({
      timeout: 5000,
      timeoutMsg: "Contiue Button not displayed"
    });
    await (await this.continueBtn).click();
    await (await LoginScreen.loginScreenText).waitForDisplayed({
      timeout: 5000,
      timeoutMsg: "Login Screen Not Displayed"
    });
    expect(await (await LoginScreen.loginScreenText).getAttribute('content-desc')).to.eq('Login to continue', "Login Page not Displayed");
    await allure.addStep("Login Screen is Displayed");
  }
}
module.exports = new ConfigureIP();
