  }
  async headerText(header) {
    return await $(`//android.view.View[contains(@content-desc,'${header}')]`);
  }
  async validateHeaderInResults(header) {
    const ele = await this.headerText(header);
    console.log(ele);
    if ((await (await this.headerText(header)).isDisplayed()) == true) {
      await allure.addStep(`${header} header is Displayed`);
