    const actualAWB = await (await (await this.awbNoTextfield).getText()).split(',');
    await driver.waitUntil(async () => (await actualAWB[0]) == awbNumber, {
      timeout: 5000,
      timeoutMsg: "Entered AWB is not reflected"
    });
    await expect(actualAWB[0]).to.be.eq(awbNumber, "Displayed AWB Number doesnt match with the entered AWB No");
    await (await this.searchParcelBtn).waitForDisplayed({
      timeout: 5000,
      timeoutMsg: "Search Parcel Not displayed"
    });
    await (await this.searchParcelBtn).click();
    await driver.hideKeyboard();
    if (await (await this.parcelNotFoundText).isDisplayed()) {
      console.log("Entered AWB No Does not exist or there is no data found for the Search");
      await allure.addStep("Entered AWB No Does not exist or there is no data found for the Search");
    } else {
      await (await this.parcelSearchResults).waitForDisplayed({
        timeout: 5000,
        timeoutMsg: "Search Results not displayed"
      });
      expect(await (await this.parcelSearchResults).getText()).to.contains(`Showing AWB ${awbNumber}`, "Search Results Expected doesnot match with Actual");
      await allure.addStep(`Search Results are Displayed for AWB Number ${awbNumber}`);
    }
  }
  async searchBin(binID) {
    await (await homeScreen.searchingModuleBtn).waitForDisplayed({
      timeout: 5000,
      timeoutMsg: "Searching button not displayed"
    });
