/* IMPORTS */
const expect = require('chai').expect
const homeScreen = require('../screenObjects/home.screen')
const Homescreen = require('../screenObjects/home.screen')
const allure = require('@wdio/allure-reporter')
// const testData = require('../testData/data')

/* GETTERS AND METHODS */

class SearchingScreen {

    get searchingScreenText() {
        return $("~SEARCHING")
    }

    get parcelTab() {
        return $("//android.view.View[contains(@content-desc,'Parcel') and contains(@content-desc,'Tab 1 of 3')]")
    }

    get binTab() {
        return $("//android.view.View[contains(@content-desc,'Bin') and contains(@content-desc,'Tab 2 of 3')]")
    }

    get bagIDTab() {
