        return $("android.widget.EditText")
    }

    get binIDTextfield() {
        return $("android.widget.EditText")
    }

    get bag_SealIDTextfield() {
        return $("android.widget.EditText")
    }

    get binNotFoundText() {
        return $("~Bin not found")
    }

    get parcelNotFoundText() {
        return $("~Parcel not found")
    }

    get bagNotFoundText() {
        return $("~Bag not found")
    }

    get bagIDSearchResults() {
        return $("//android.widget.EditText[contains(@text,'Showing Bag ID ubr_B011_10000192160')]")
    }

    get binIDSearchResults() {
        return $("//android.widget.EditText[contains(@text,'Showing BIN ID A101')]")
    }

    get parcelSearchResults() {
        return $("//android.widget.EditText[contains(@text,'Showing AWB 5963508146411')]")
    }

    async headerText(header) {
        return await $(`//android.view.View[contains(@content-desc,'${header}')]`)
    }

    async validateHeaderInResults(header) {
        const ele=await this.headerText(header)
        console.log(ele);
        if (await (await this.headerText(header)).isDisplayed()==true) {
            await allure.addStep(`${header} header is Displayed`)
        }
        else if(await (await this.headerText(header)).isDisplayed()==false){
            await driver.execute('mobile:scroll',{direction:'down'})
            await allure.addStep(`${header} header is Displayed`)
        }
        else{
            await allure.addStep(`${header} header is not Displayed`)
        }
    }

    async searchParcel(awbNumber) {
        await (await homeScreen.searchingModuleBtn).waitForDisplayed({ timeout: 5000, timeoutMsg: "Searching button not displayed" })
        await (await Homescreen.searchingModuleBtn).click()
        await (await this.searchingScreenText).waitForDisplayed({ timeout: 5000, timeoutMsg: "Searching Screen is not displayed" })
        expect((await (await this.searchingScreenText).getAttribute('content-desc'))).to.eq('SEARCHING', "Searching Screen text doesnt not match with expected")
        await (await this.parcelTab).waitForDisplayed({ timeout: 5000, timeoutMsg: "Bag Tab Not displayed" })
        await allure.addStep("Parcel Tab is Displayed")
        await this.parcelTab.click()
        await (await this.awbNoTextfield).waitForDisplayed({ timeout: 5000, timeoutMsg: "AWB Textfield not displayed" })
        await (await this.awbNoTextfield).setValue(awbNumber)
        await allure.addStep(`Entered AWB Number is ${awbNumber}`)
        const actualAWB = await (await (await this.awbNoTextfield).getText()).split(',')
        await driver.waitUntil(async () => await actualAWB[0] == awbNumber, {
            timeout: 5000,
            timeoutMsg: "Entered AWB is not reflected"
        })
        await expect(actualAWB[0]).to.be.eq(awbNumber, "Displayed AWB Number doesnt match with the entered AWB No")
        await (await this.searchParcelBtn).waitForDisplayed({ timeout: 5000, timeoutMsg: "Search Parcel Not displayed" })
        await (await this.searchParcelBtn).click()
        await driver.hideKeyboard()
        if (await (await this.parcelNotFoundText).isDisplayed()) {
            console.log("Entered AWB No Does not exist or there is no data found for the Search");
            await allure.addStep("Entered AWB No Does not exist or there is no data found for the Search")
        }
        else {
            await (await this.parcelSearchResults).waitForDisplayed({ timeout: 5000, timeoutMsg: "Search Results not displayed" })
            expect(await (await this.parcelSearchResults).getText()).to.contains(`Showing AWB ${awbNumber}`, "Search Results Expected doesnot match with Actual")
            await allure.addStep(`Search Results are Displayed for AWB Number ${awbNumber}`)
        }
    }

    async searchBin(binID) {
        await (await homeScreen.searchingModuleBtn).waitForDisplayed({ timeout: 5000, timeoutMsg: "Searching button not displayed" })
        await (await Homescreen.searchingModuleBtn).click()
        await (await this.searchingScreenText).waitForDisplayed({ timeout: 5000, timeoutMsg: "Searching Screen is not displayed" })
        expect((await (await this.searchingScreenText).getAttribute('content-desc'))).to.eq('SEARCHING', "Searching Screen text doesnt not match with expected")
        await (await this.binTab).waitForDisplayed({ timeout: 5000, timeoutMsg: "Parcel Tab Not displayed" })
        await allure.addStep("Bin Tab is Displayed")
        await this.binTab.click()
        await (await this.binIDTextfield).waitForDisplayed({ timeout: 5000, timeoutMsg: "AWB Textfield not displayed" })
