        await allure.addStep(`Entered binID is ${binID}`)
        const actualbinID = await (await (await this.binIDTextfield).getText()).split(',')
        await driver.waitUntil(async () => await actualbinID[0] == binID, {
            timeout: 5000,
            timeoutMsg: "Entered BinID is not reflected"
        })
        await expect(actualbinID[0]).to.be.eq(binID, "Displayed binID doesnt match with the entered binID")
        await (await this.searchBinIDBtn).waitForDisplayed({ timeout: 5000, timeoutMsg: "Search Parcel Not displayed" })
        await (await this.searchBinIDBtn).click()
        await driver.hideKeyboard()
        // await this.validateHeaderInResults(testData.binResultHeaders.binLevel)
        if (await (await this.binNotFoundText).isDisplayed()) {
            console.log("Entered BinID Does not exist or there is no data found for the Search");
            await allure.addStep("Entered BinID Does not exist or there is no data found for the Search")
        }
        else {
            await (await this.binIDSearchResults).waitForDisplayed({ timeout: 5000, timeoutMsg: "Search Results not displayed" })
            expect(await (await this.binIDSearchResults).getText()).to.contains(`Showing BIN ID ${binID}`, "Search Results Expected doesnot match with Actual")
            await allure.addStep(`Search Results are Displayed for BinID ${binID}`)
        }
    }

    async searchBag(bagSealID) {
        await (await homeScreen.searchingModuleBtn).waitForDisplayed({ timeout: 5000, timeoutMsg: "Searching button not displayed" })
        await (await Homescreen.searchingModuleBtn).click()
        await (await this.searchingScreenText).waitForDisplayed({ timeout: 5000, timeoutMsg: "Searching Screen is not displayed" })
        expect((await (await this.searchingScreenText).getAttribute('content-desc'))).to.eq('SEARCHING', "Searching Screen text doesnt not match with expected")
        await (await this.bagIDTab).waitForDisplayed({ timeout: 5000, timeoutMsg: "Bag tab Not displayed" })
        await allure.addStep("Bag Tab is Displayed")
        await this.bagIDTab.click()
        await (await this.bag_SealIDTextfield).waitForDisplayed({ timeout: 5000, timeoutMsg: "Bag/Seal_ID Textfield not displayed" })
        await (await this.bag_SealIDTextfield).setValue(bagSealID)
        await allure.addStep(`Entered Bag/Seal_ID is ${bagSealID}`)
        const actualbagID = await (await (await this.bag_SealIDTextfield).getText()).split(',')
        await driver.waitUntil(async () => await actualbagID[0] == bagSealID, {
            timeout: 5000,
            timeoutMsg: "Entered BagID is not reflected"
        })
        await expect(actualbagID[0]).to.be.eq(bagSealID, "Displayed BagID doesnt match with the entered BagID")
        await (await this.searchBagBtn).waitForDisplayed({ timeout: 5000, timeoutMsg: "Search BagID Not displayed" })
        await (await this.searchBagBtn).click()
        await driver.hideKeyboard()
        if (await (await this.bagNotFoundText).isDisplayed()) {
            console.log("Entered BagID Does not exist or there is no data found for the Search");
            await allure.addStep("Entered BagID Does not exist or there is no data found for the Search")
        }
        else {
            await (await this.bagIDSearchResults).waitForDisplayed({ timeout: 5000, timeoutMsg: "Search Results not displayed" })
            expect(await (await this.bagIDSearchResults).getText()).to.contains("Showing Bag ID", "Search Results Expected doesnot match with Actual")
            await allure.addStep(`Search Results are Displayed for BagID ${bagSealID}`)
        }
    }

}
module.exports = new SearchingScreen();

