        await driver.hideKeyboard()
    }

    async verifyHeadersOfaBin(BinID) {
            try {
                while ((await (await this.searchedBinId(BinID)).isDisplayed()) == false) {
                    await (await this.homeScreenText).click()
                    const { height } = await driver.getWindowSize()
                    const anchorPercentage = 50
                    const startPointPercentage = 90
                    const endPointPercentage = 70
                    const anchor = height * anchorPercentage / 100
                    const startPoint = height * startPointPercentage / 100
                    const endPoint = height * endPointPercentage / 100
                    await driver.touchPerform([
                        {
                            action: 'press',
                            options: {
                                x: anchor,
                                y: startPoint
                            }
                        },
                        {
                            action: 'wait',
                            options: {
                                ms: 1000
                            }
                        },
                        {
                            action: 'moveTo',
                            options: {
                                x: anchor,
                                y: endPoint
                            }
                        },
                        {
                            action: 'release',
                            options: {}
                        }
                    ])
                }
            }
            catch (error) {
                console.log(error)
            } 
        await (await this.searchedBinId(BinID)).click()
        await SearchedBinScreen.verifyHeader(testData.binResultHeaders.sortid)
        await SearchedBinScreen.verifyHeader(testData.binResultHeaders.binstatus)
        await SearchedBinScreen.verifyHeader(testData.binResultHeaders.currentUbrBagID)
        await SearchedBinScreen.verifyHeader(testData.binResultHeaders.numberOfClosed)
        await SearchedBinScreen.verifyHeader(testData.binResultHeaders.timecutoff)
        await SearchedBinScreen.verifyHeader(testData.binResultHeaders.weightCutOff)
        await SearchedBinScreen.verifyHeader(testData.binResultHeaders.volumeCutOff)
        await SearchedBinScreen.verifyHeader(testData.binResultHeaders.parcelCount)
        await (await SearchedBinScreen.backButton(BinID)).waitForDisplayed({ timeout: 5000, timeoutMsg: "Back Button not displayed" })
        await (await SearchedBinScreen.backButton(BinID)).click()
    }

    async verifyBinByStatus(binStatus) {
        await (await this.statusDropdownButton).waitForDisplayed({ timeout: 5000, timeoutMsg: "Status dropdown not displayed" })
        await (await this.statusDropdownButton).click()
        await (await this.selectBinStatus(binStatus)).waitForDisplayed({ timeout: 5000, timeoutMsg: `${binStatus} is not displayed` })
        const len = await (await (await this.selectBinStatus(binStatus)).getAttribute('content-desc')).split(' ')[1].split('(').join('').split(')').join('')
        await (await this.selectBinStatus(binStatus)).click()
        console.log(len);
        if (Number(len) == 0) {
            await allure.addStep(`No bins exists for the status "${binStatus}"`)
        }
        else {
            var len2 = Number(len) / 5
            await allure.addStep(`List of Bins ${binStatus}`)
            for (let index = 0; index <= len2 - 2; index++) {
                await (await this.homeScreenText).click()
                const { height } = await driver.getWindowSize()
                const anchorPercentage = 50
                const startPointPercentage = 90
                const endPointPercentage = 50
                const anchor = height * anchorPercentage / 100
                const startPoint = height * startPointPercentage / 100
                const endPoint = height * endPointPercentage / 100
                await driver.touchPerform([
                    {
                        action: 'press',
                        options: {
                            x: anchor,
                            y: startPoint
                        }
                    },
                    {
                        action: 'wait',
                        options: {
                            ms: 1000
                        }
                    },
                    {
                        action: 'moveTo',
                        options: {
                            x: anchor,
                            y: endPoint
                        }
                    },
                    {
                        action: 'release',
                        options: {}
                    }
                ])
                switch (binStatus) {
                    case 'All': for (const iterator of await this.binsList) {
                        expect(await iterator.getAttribute('content-desc')).to.contain.oneOf(["ACTIVE", "STOPPED", "DEACTIVATED"])
                    }
                        break;
                    case 'Active': for (const iterator of await this.binsList) {
                        expect(await iterator.getAttribute('content-desc')).to.contain("ACTIVE")
                    }
                        break;
                    case 'Stopped': for (const iterator of await this.binsList) {
                        expect(await iterator.getAttribute('content-desc')).to.contain("STOPPED")
                    }
                        break;
                    case 'Deactivated': for (const iterator of await this.binsList) {
                        expect(await iterator.getAttribute('content-desc')).to.contain("DEACTIVATED")
                    }
                        break;

                    default: "Enter Proper Bin Status"
                        break;
                }
                for (const iterator of await this.binsList) {
                    await allure.addStep(`${await iterator.getAttribute('content-desc')}`)
                }
            }
        }
