        const endPoint = height * endPointPercentage / 100
        await driver.touchPerform([
            {
                action: 'press',
                options: {
                    x: anchor,
                    y: startPoint
                }
            },
            {
                action: 'wait',
                options: {
                    ms: 1000
                }
            },
            {
                action: 'moveTo',
                options: {
                    x: anchor,
                    y: endPoint
                }
            },
            {
                action: 'release',
                options: {}
            }
        ])
        if (orderBy == 1) {
            var orderbyoption = "Ascending"
        }
        else {
            orderbyoption = "Descending"
        }
        await (await this.orderByOption(orderBy)).waitForDisplayed({ timeout: 5000, timeoutMsg: `${orderbyoption} option is not displayed` })
        await (await this.orderByOption(orderBy)).click()
        await allure.addStep(`${orderbyoption} option is selected`)
        await driver.back()
        await (await this.showingResultText(filterBinbyText)).waitForDisplayed({ timeout: 5000, timeoutMsg: "Showing results doesnt match with the expected" })
        const text = await (await this.showingResultText(filterBinbyText)).getAttribute('content-desc')
        await expect(text).to.eq(filterBinbyText, `Actual selection is ${text} and Expected selection is ${filterBinbyText}`)
        const bins = await this.filteredBins
        for (const iterator of bins) {
            expect(await iterator.getAttribute('content-desc')).to.contain(filterBinbyText, "Filtered result is not displayed according to FilterBin by Name")
            await allure.addStep(await iterator.getAttribute('content-desc'))
        }
        await allure.addStep(`Bins are displayed for name "${filterBinbyText}"`)
        await allure.addStep(`Bins are sorted based on "${sortBy}"`)
        await allure.addStep(`Bins are ordered in ${orderbyoption}`)
    }

}
