                    },
                    {
                        action: 'moveTo',
                        options: {
                            x: anchor,
                            y: endPoint
                        }
                    },
                    {
                        action: 'release',
                        options: {}
                    }
                ])
            }
            catch (error) {
                await console.log(error);
            }
        }
    }

    async verifyAllTheComponents() {
        await (await Homescreen.baggingModuleBtn).waitForDisplayed({ timeout: 5000, timeoutMsg: "Bagging Icon not displayed" })
        await (await Homescreen.baggingModuleBtn).click()
        await driver.hideKeyboard()
        await (await this.baggingScreenText).waitForDisplayed({ timeout: 5000, timeoutMsg: "Bagging screen text not displayed" })
        expect(await (await this.baggingScreenText).getAttribute('content-desc')).to.eq("BAGGING", "Bagging screen text doesnt match with expected")
        await allure.addStep("Bagging Screen is displayed")
