        await (await this.binsNumber).waitForDisplayed({ timeout: 5000, timeoutMsg: "Number of Bins text is not displayed" })
        await allure.addStep("Number of Bins text is displayed")
    }

    async verifyFilterFunctionality(filterBinbyText, sortBy, orderBy) {
