        y: startPoint
      }
    }, {
      action: 'wait',
      options: {
        ms: 1000
      }
    }, {
      action: 'moveTo',
      options: {
        x: anchor,
        y: endPoint
      }
    }, {
      action: 'release',
      options: {}
    }]);
    if (orderBy == 1) {
      var orderbyoption = "Ascending";
    } else {
      orderbyoption = "Descending";
    }
