    await driver.back();
    await driver.hideKeyboard();
    await (await this.showingResultText(filterBinbyText)).waitForDisplayed({
      timeout: 5000,
      timeoutMsg: "Showing results doesnt match with the expected"
    });
    const text = await (await this.showingResultText(filterBinbyText)).getAttribute('content-desc');
    await expect(text).to.eq(filterBinbyText, `Actual selection is ${text} and Expected selection is ${filterBinbyText}`);
    await driver.touchPerform([{
      action: 'press',
      options: {
        x: 897,
        y: 1435
      }
    }, {
      action: 'wait',
      options: {
        ms: 1000
      }
    }, {
      action: 'moveTo',
      options: {
        x: 897,
        y: 358
      }
    }, {
      action: 'release',
      options: {}
    }]);
    const bins = await this.filteredBins;
    for (const iterator of bins) {
      expect(await iterator.getAttribute('content-desc')).to.contain(filterBinbyText, "Filtered result is not displayed according to FilterBin by Name");
