        return $("~Submit")
    }

    get filterButton() {
        return $("//android.view.View[contains(@content-desc,'Bins')]/following-sibling::android.widget.ImageView")
    }

    get binsNumber() {
        return $("//android.view.View[contains(@content-desc,'Bins')]")
    }

    get filterPopUpHeader() {
        return $("//android.view.View[@content-desc='Filters']")
    }

    async filterByOption(option) {
        return $(`~${option}`)
    }

    get filterByNameText() {
        return $("~Filter By Name")
    }

    get sortByText() {
        return $("~Sort By ")
    }

    get sortByParcelCount() {
        return $("~Parcel Count")
    }

    get sortByElapsedTime() {
        return $("~Elapsed Time")
    }

    async sortByOption(option) {
        return $(`//android.widget.Button[@content-desc="${option}"]`)
    }

    get orderByText() {
        return $("~Ordered By ")
    }

