        return $("//android.view.View[@content-desc='Ordered By ']/following-sibling::android.view.View/android.view.View/android.view.View[1]")
    }

    get orderByDecreasingButton() {
        return $("//android.view.View[@content-desc='Ordered By ']/following-sibling::android.view.View/android.view.View/android.view.View[2]")
    }

    async showingResultText(text) {
        return $(`//android.view.View[@content-desc="${text}"]`)
    }

    async orderByOption(option) {
        return $(`//android.view.View[@content-desc='Ordered By ']/following-sibling::android.view.View/android.view.View/android.view.View[${option}]`)
    }

    get closeButton() {
        return $("//android.view.View[@content-desc='Filters']/following-sibling::android.widget.Button")
    }

