        return $("//android.view.View[contains(@content-desc,'Bag Seal Id is already attached to') and contains(@content-desc,'another bag') and contains(@content-desc,'X')]")
    }

    get removeBagBeforeClosingText() {
        return $("//android.view.View[contains(@content-desc,'Please remove bag from') and contains(@content-desc,' before') and contains(@content-desc,' closing the') and contains(@content-desc,' bag,cant close.') and contains(@content-desc,'X')]")
    }

    get invalidRegexText() {
        return $("//android.view.View[contains(@content-desc,'regex validation failed')]")
    }

    get cantCloseEmptyBinText() {
        return $("//android.view.View[contains(@content-desc,'Cant close an empty bin.No parcel in A071 ') and contains(@content-desc,'X')]")
    }

    get bagClosedSuccessfully() {
        return $("//android.view.View[contains(@content-desc,'Bag closed successfully')]")
    }

    async searchedBinId(binID) {
        return $(`//android.widget.ImageView[contains(@content-desc,'${binID}')]`)
    }

    async stoppedBinWithParcelCheck() {
        var binName = ""
        await (await Homescreen.statusDropdownButton).waitForDisplayed({ timeout: 5000, timeoutMsg: "Status Drop down not clickable" })
        await (await Homescreen.statusDropdownButton).click()
        const len = await (await (await Homescreen.selectBinStatus(testData.binStatus.stopped)).getAttribute('content-desc')).split(' ')[1].split('(').join('').split(')').join('')
        const len2 = Math.ceil(Number(len) / 3)
        await (await Homescreen.stoppedBinSttaus).waitForDisplayed({ timeout: 5000, timeoutMsg: "Active bin option not displayed" })
        await (await Homescreen.stoppedBinSttaus).click()
        for (let i = 0; i < len2; i++) {
            try {
                var bins = await homeScreen.binsList
                for (const iterator of bins) {
                    await iterator.waitForDisplayed({ timeout: 5000, timeoutMsg: "No Bins found" })
                    const contdesc = await (await iterator.getAttribute('content-desc'))
                    var parcelCount = Number(Array(contdesc)[0].split(' ')[3])
                    if (parcelCount > 0) {
                        binName = Array(contdesc)[0].split('\n')[1]
                        await console.log(`This is BIN ID ${Array(contdesc)[0].split('\n')[1]} and parcel count is ${Number(Array(contdesc)[0].split(' ')[3])}`);
                        return binName
                    }
                }
                await (await Homescreen.homeScreenText).click()
                const { height } = await driver.getWindowSize()
                const anchorPercentage = 50
                const startPointPercentage = 60
                const endPointPercentage = 40
                const anchor = height * anchorPercentage / 100
                const startPoint = height * startPointPercentage / 100
                const endPoint = height * endPointPercentage / 100
                await driver.touchPerform([
                    {
                        action: 'press',
                        options: {
                            x: anchor,
                            y: startPoint
                        }
                    },
                    {
                        action: 'wait',
                        options: {
                            ms: 1000
                        }
                    },
                    {
                        action: 'moveTo',
                        options: {
                            x: anchor,
                            y: endPoint
                        }
                    },
                    {
                        action: 'release',
                        options: {}
                    }
                ])
            }
            catch (error) {
                await console.log(error);
            }
        }
    }

    async activeBinWithParcelCheck() {
        var binName = ""
        await (await Homescreen.statusDropdownButton).waitForDisplayed({ timeout: 5000, timeoutMsg: "Status Drop down not clickable" })
        await (await Homescreen.statusDropdownButton).click()
        const len = await (await (await Homescreen.selectBinStatus(testData.binStatus.active)).getAttribute('content-desc')).split(' ')[1].split('(').join('').split(')').join('')
        const len2 = Math.ceil(Number(len) / 3)
        await (await Homescreen.activeBinStatus).waitForDisplayed({ timeout: 5000, timeoutMsg: "Active bin option not displayed" })
