describe(`performance`, async () => {
    it(`Metrics`, async () => {
        var types=await browser.getPerformanceDataTypes()
        console.log(types);
        await Loginscreen.loginToAppWithInvalidCredentials(testData.inValidCredentials.invalidJobID, testData.inValidCredentials.invalidPwd)
